import React, {Component} from "react";
import "./App.css";

class App extends React.Component {
  render() {
    return (
      <div id="App-header">
        <h1>카 고</h1>
        <h6>주변 카페 자리를 확인해보세요~</h6>


        <input id="search" type="search"></input>
        <input id="searchBtn" type="submit" value="검색"></input> 

        <div id="App-Btn">
          <a
           className="App-link"
           href="https://reactjs.org"
           target="_blank"
           rel="noopener noreferrer"
           >
             현재 위치로 확인
          </a>
        </div>
      </div>

    );
  }
}


export default App;
